let working_code_table = {}
for (var channel in CHANNEL_WORKING_CODE)
{
    const codes = CHANNEL_WORKING_CODE[channel]

    working_code_table[channel] = {}
    for (var index in codes)
    {
        const value = codes[index].VALUE
        const code = codes[index].CODE

        working_code_table[channel][value] = code
    }
}

const db_payload = msg.payload

let working_code_list = []

for (var i = 0; i < db_payload.length; ++i)
{
    row = db_payload[i]

    time = row.time
    delete row.time

    for (var channel_ in row)
    {
        const channel_id = channel_
        const value = row[channel_id]

        if (value === null)
        {
            continue
        }

        if (!working_code_table.hasOwnProperty(channel_id))
        {
            node.error(channel_id + ' not defined')
            continue
        }

        const code = working_code_table[channel_id]
        if (!code.hasOwnProperty(value))
        {
            node.error(channel_id + ': ' + value + ' not defined')
            continue
        }

        working_code_list.push(
            {
                time: time,
                code: code[value]
            }
        )
    }
}

msg.working_code_list = working_code_list

return msg;

